package vn.edu.iuh.fit.pks;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;import java.io.Serializable;import java.util.Objects;@Getter@Setter@NoArgsConstructor@AllArgsConstructorpublic class TourGuideAssignmentId implements Serializable {    private long departure;    private long tourGuide;    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (!(o instanceof TourGuideAssignmentId that)) return false;        return getDeparture() == that.getDeparture() && getTourGuide() == that.getTourGuide();    }    @Override    public int hashCode() {        return Objects.hash(getDeparture(), getTourGuide());    }}